import React from "react";
import { useParams } from "react-router-dom";

function Thread() {
  const { id } = useParams();

  return (
    <div>
      <h1>Thread {id}</h1>
      <p>This is the thread page for thread {id}.</p>
    </div>
  );
}

export default Thread;
